import About from "./pages/About";

function App() {
  return (
    <>
      <Navebar />
      <Switch>
        <Route path="/" exact component={Home} />

      </Switch>

      <footer>
        <p>Copyright Â© Dashboard 2022</p>
      </footer>
    </>
  );
}

export default App;
